import React from 'react'
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link,
} from 'react-router-dom'
import classes from './MenuHome.module.css'

const MenuHome = () => {
  const Home = () => {
    return <h2>Home</h2>
  }

  const BecomeATeacher = () => {
    return <h2>BecomeATeacher</h2>
  }

  const Account = () => {
    return <h2>Account</h2>
  }
  const Courses = () => {
    return <h2>Courses</h2>
  }
  const listMenu = [
    {
      id: 1,
      title: 'Home',
      link: '/',
    },
    {
      id: 2,
      title: 'Courses',
      link: '/courses',
    },
    {
      id: 3,
      title: 'Become a teacher',
      link: '/becomeateacher',

    },
    {
      id: 4,
      title: 'Account',
      link: '/account',
    },
  ]
  return (
    <Router>
      <div className={classes.AppHeaderMenu}>
        <nav>
          <ul className={classes.AppHeaderMenuItem}>
            {listMenu.map((item) => <li key={item.id}>
              <Link
                to={item.link}
              >
                {item.title}
              </Link>
            </li>)}
          </ul>
        </nav>
        <Switch>
          <Route path="/" component={Home} />
          <Route path="/courses" component={Courses} />
          <Route path="/becomeateacher" component={BecomeATeacher} />
          <Route path="/account" component={Account} />
        </Switch>
      </div>
    </Router>
  )
}
export default MenuHome
